import React from 'react';
import './Header.css';
import Basket from '../views/Basket';

function Header({setPage}) {

  return (
    <div className="Header">
      <ul>
      <li onClick={() => setPage ('')}>Корзина</li>
        <li onClick={() => setPage ('Basket')}>Корзина</li>
      </ul>
    </div>
  );
}

export default Header;
